%[text] 根据 ImageJ RoiSet 配准图像
%[text] 此函数接受 ImageJ RoiSet 和晃动图输入，根据RoiSet中圈定的特征点位置进行匹配，得到变换矩阵，然后配准输入图像，并返回所用的变换矩阵。
%[text] ROI包括固定ROI和晃动ROI。每个晃动ROI应当对应一个晃动图文件，且具有相同的Z层数。固定ROI要么只有一个被所有晃动图共用，要么为每个晃动ROI匹配一个对应的固定ROI。将计算出一个变换矩阵，使得晃动ROI的中心点变换到对应固定ROI的位置，并用同样的矩阵变换晃动图文件，生成ROI配准图文件。
%[text] 为此，晃动ROI文件中包含的ROI个数和位置顺序，必须与对应固定ROI文件中包含的ROI个数和位置顺序一一对应。不对应不一定会出错，而可能会生成完全错误扭曲的配准图和变换矩阵。Z层数可以容许一定程度上的不同，固定ROI可以比晃动ROI具有更多的Z层数，将对前几个Z层匹配，后续Z层将会忽略；但是，晃动图文件和ROI的Z层数必须相等。
%[text] ## 语法
%[text] ```matlabCodeExample
%[text] TransMatrix=UniExp.RoiRegister(PathTable);
%[text] %根据路径进行匹配变换，输出到当前目录
%[text] 
%[text] TransMatrix=UniExp.RoiRegister(PathTable,FixedRoi);
%[text] %额外指定单个固定图ROI文件
%[text] 
%[text] TransMatrix=UniExp.RoiRegister(___,OutputDirectory);
%[text] %与上述任意语法组合使用，额外指定输出目录
%[text] ```
%[text] ## 示例
%[text] 错误ROI示例。ROI序号与图上位置不匹配，将导致配准结果异常。
%[text] ![错误.jpg](text:image:9045)
%[text] 正确ROI示例
%[text] ![正确1.jpg](text:image:3cd2)
%[text] 所有Z层都必须全部按顺序严格对应匹配
%[text] ![正确2.jpg](text:image:81bb)
%[text] ```matlabCodeExample
%[text] %用ImageJ打开首日固定图和平均值图像，为每个文件的每个Z层圈出数量相同的标志性特征ROI（细胞、血管端等）。
%[text] %圈ROI是一个玄学步骤，原则上应该期望固定图中圈出的特征ROI在配准目标图中都能找到精确对应的位置并圈为ROI。一般建议数量4~5个左右，彼此之间尽量远离（如四角和中央）。局部变形严重的也可以多圈一些，但圈太多反而可能过拟合导致更加奇怪的畸变，效果不一定会更好。一般来说，同一层最多圈14个，超过14个几乎一定会过拟合。
%[text] %同一个文件圈出的ROI，无论Z层，保存到同一个RoiSet。不同文件的ROI保存到不同的RoiSet。RoiSet文件名排序应当与图像文件相同，不同文件之间对应的ROI应该具有相同的序号。
%[text] %比较简单的方法是为每个图各圈一个ROI文件，但这要求你选择的特征ROI在所有图中都存在且位置清晰。如果不能保证所有图中都存在相同的高质量ROI，还可以用配对法。即，不要求每个晃动图的ROI都相同，而是为每个晃动图ROI文件各自配一个固定图的ROI文件。例如有10张晃动图，你就要圈10个晃动ROI文件，然后为每个文件各自圈一个匹配的固定图ROI文件，最终得到10个晃动ROI文件和10个固定ROI文件。固定-晃动配对ROI文件必须具有相同的ROI特征，但不同对之间则不需要。
%[text] %然后选择文件：
%[text] FixedRoi=MATLAB.UITools.OpenFileDialog(Filter='ImageJ RoiSet|*.zip',Multiselect=true,Title='选择从第一天固定图圈出的RoiSet')';
%[text] MovingRoi=MATLAB.UITools.OpenFileDialog(Filter='ImageJ RoiSet|*.zip',Multiselect=true,Title='选择所有从晃动图圈出的RoiSet')';
%[text] MovingImage=MATLAB.UITools.OpenFileDialog(Filter='TIFF or OIR|*.tif;*.oir',Multiselect=true,Title='选择所有晃动图')';
%[text] %MovingSamples应当是平均值图像或每日参照图等单帧图像，而不是具有时间跨度的原始视频。如果采用配对ROI，请检查FixedRois、MovingRois和MovingSamples是否具有一一对应的顺序。如果发现卡在这一段无法运行下去，请最小化MATLAB窗口，检查是否打开了正在等待你选择文件的对话框。
%[text] 
%[text] %执行试配准，返回跨文件变换矩阵。
%[text] if isscalar(FixedRoi)
%[text] 	TransMatrix = UniExp.RoiRegister(table(MovingRoi,MovingImage),FixedRoi,OutputDirectory);
%[text] else
%[text] 	TransMatrix = UniExp.RoiRegister(table(MovingRoi,MovingImage,FixedRoi),OutputDirectory);
%[text] end
%[text] save(fullfile(OutputDirectory,'变换矩阵.mat'),'TransMatrix');
%[text] 
%[text] %在OutputDirectory会生成试配图像，用ImageJ打开试配图像，和固定图像比对，看配准效果如何。如果效果不满意，可以重新圈ROI再试，重圈时可优先圈那些让你感觉明显不满意的位点，而舍弃那些模棱两可的位点。
%[text] %如果试配满意，下面将使用返回的TransMatrix变换矩阵进行文件间配准。
%[text] ```
%[text] ## 输入参数
%[text] PathTable(:,2:3)table，要试配的晃动图路径表，一行一个晃动图。包含以下列：
%[text] - MovingImage(:,1)string，必需，要试配的晃动平均图的路径
%[text] - MovingRoi(:,1)string，必需，要试配的晃动RoiSet的路径
%[text] - FixedRoi(:,1)string，可选，要试配的固定RoiSet的路径 \
%[text] FixedRoi(1,1)string，固定图的ROI路径。如果PathTable中未指定FixedRoi列，则必须指定本参数；否则不允许指定本参数。
%[text] OutputDirectory(1,1)string="."，输出目录
%[text] ## 返回值
%[text] TransMatrix(:,1)cell，变换矩阵。每个元胞对应一个晃动图，元胞内是(1,:)affinetform2d，对应每个Z层。
%[text] **See also** [UniExp.BatchOirRegisterTiff](<matlab:doc UniExp.BatchOirRegisterTiff>) [UniExp.OirSampleMean](<matlab:doc UniExp.OirSampleMean>)
function TransMatrix = RoiRegister(PathTable,varargin)
ManyFixed=any(PathTable.Properties.VariableNames=="FixedRoi");
OutputDirectory='.';
for V=1:numel(varargin)
	if isfolder(varargin{V})
		OutputDirectory=varargin{V};
	elseif ~ManyFixed&&isfile(varargin{V})
		FixedRoi=RoiCenters(varargin{V});
	else
		UniExp.Exception.Unexpected_argument_type.Throw;
	end
end
NumMovings=height(PathTable);
TransMatrix=cell(NumMovings,1);
for M=1:NumMovings
	MovingRoi=RoiCenters(PathTable.MovingRoi(M));
	MovingImage=PathTable.MovingImage(M);
	[~,Filename,Extension]=fileparts(MovingImage);
	switch Extension
		case ".oir"
			Reader=Image5D.OirReader(MovingImage);
			Writer=Image5D.OmeTiffRWer.Create(fullfile(OutputDirectory,Filename+".ROI配准.tif"),Image5D.PixelType.UINT16,Reader.SizeX,Reader.SizeY,Reader.ChannelColors,Reader.SizeZ,Reader.SizeT,Image5D.DimensionOrder.XYCZT);
		case ".tif"
			Reader=Image5D.OmeTiffRWer.OpenRead(MovingImage);
			Writer=Image5D.OmeTiffRWer.Create(fullfile(OutputDirectory,Filename+".ROI配准.tif"),Reader.ImageDescription);
		otherwise
			UniExp.Exception.The_MovingSamples_extension_must_be_oir_or_tif.Throw(sprintf('第%u个MovingSamples扩展名不正确',M));
	end
	if Reader.SizeT>1
		UniExp.Exception.Moving_image_is_a_video.Throw(sprintf('第%u个晃动图是视频，请选择单帧图像文件',M));
	end
	MovingImage=Reader.ReadPixels;
	RefObj=imref2d(size(MovingImage));
	[~,~,SizeZ]=size(MovingImage);
	if SizeZ~=numel(MovingRoi)
		UniExp.Exception.ZLayers_of_the_moving_ROI_and_file_do_not_match.Throw(sprintf('第%u个晃动图和ROI的Z层数不同',M));
	end
	if ManyFixed
		FixedRoi=RoiCenters(PathTable.FixedRoi(M));
	end
	TM=cell(1,SizeZ);
	for Z=1:SizeZ
		if height(MovingRoi{Z})~=height(FixedRoi{Z})
			UniExp.Exception.Numbers_of_fixed_and_moving_ROIs_vary.Throw(sprintf('第%u个文件的第%u层，固定和晃动图ROI数目不同',M,Z));
		end
		TM{Z}=ImageProcessing.FitGeoTForm2D(cat(3,MovingRoi{Z},FixedRoi{Z}));
		MovingImage(:,:,Z)=imwarp(MovingImage(:,:,Z),TM{Z},OutputView=RefObj);
	end
	Writer.WritePixels(MovingImage);
	TransMatrix{M}=TM;
end
end
%%
function CxyZ=RoiCenters(Roi)
[Cxy,~,Zs]=UniExp.internal.ImageJRoiReadout(Roi);

%Zs可能只有2
[Groups,Zs]=findgroups(Zs);

%因为imwarp会颠倒XY，最方便的方法就是这里进行颠倒
CxyZ(Zs)=splitapply(@(CP){CP},fliplr(Cxy),Groups);
end

